import React from 'react';
import './App.css';

const App: React.FC = () => {
  return (
    <div className="app-container">
      <header className="App-header">
        <h1>Blood Donation Awareness</h1>
      </header>
      <main className="main-content">
        <div style={{ padding: '2rem', textAlign: 'center' }}>
          <h2>Welcome to Blood Donation Awareness</h2>
          <p>This is a simplified version of the application to test rendering.</p>
        </div>
      </main>
      <footer style={{ textAlign: 'center', padding: '1rem', backgroundColor: '#f5f5f5' }}>
        <p>Blood Donation Awareness &copy; 2023</p>
      </footer>
    </div>
  );
};

export default App;
